import React from "react";
import { Outlet } from "react-router-dom";

const Layout = () => {

  return (
    <>
      <button class="btn">Home</button>
      <button class="btn">Login</button>
      <button class="btn">Signup</button>
      <button class="btn">Content</button>
      <Outlet />
    </>
  );
};

export default Layout;
